const removePuppy = async (puppyId) => {
  try {
    const response = await fetch(`${apiUrl}/${puppyId}`, {
      method: "DELETE",
    });
    const result = await response.json();
    console.log(result);
  } catch (error) {
    console.error(error);
  }
};

export default removePuppy;
